// src/pages/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h1>Welcome to Railway Booking System!</h1>
      <nav>
        <Link to="/train-search">Search Trains</Link> <br />
        <Link to="/reservations">My Reservations</Link> <br />
        <Link to="/faq">FAQs</Link>
      </nav>
    </div>
  );
};

export default Home;
